export interface HeaderMultiValue {
    get(name: string): string;
    set(name: string, value: string): HeaderMultiValue;
    remove(name: string): HeaderMultiValue;
    names(): string[];
    toString(): string;
}

export function parse(headerValue: string, caseInsensitive?: boolean, tolerant?: boolean): HeaderMultiValue;
export function create(kvps: {[key: string]: any}, caseInsensitive?: boolean): string;
